import React from 'react'


const Nav = () => {
  const categories = [
    "Dogs",
    "Cats",
    "Jokes",
    "Inspiration"
  ]
  return (
    <nav className='w-auto'>
      <ul className='flex m-auto justify-center'>

          categories.forEach((category, key) => {
            <li className='text-lg' key={key}>
              {category}
            </li>
          }) 

      </ul>
    </nav>
  )
}

export default Nav
